import React from 'react';
import {Col, Container, Row} from "react-bootstrap";
import GenusBar from "../components/GenusBar";
import ProductList from "../components/ProductList";

const HomePage = () => {
    return (
        <Container>
            <Row className="mt-3">
                <Col md={3}>
                    <GenusBar/>
                </Col>
                <Col md={9}>
                    <ProductList/>
                </Col>
            </Row>
        </Container>
    );
};

export default HomePage;
